webpackJsonp([49],{834:function(n,e){n.exports='Tree \u6811\u5f62\u63a7\u4ef6\n===\n\n\u4f7f\u7528`\u6811\u63a7\u4ef6`\u53ef\u4ee5\u5b8c\u6574\u5c55\u73b0\u5176\u4e2d\u7684\u5c42\u7ea7\u5173\u7cfb\uff0c\u5e76\u5177\u6709\u5c55\u5f00\u6536\u8d77\u9009\u62e9\u7b49\u4ea4\u4e92\u529f\u80fd\u3002\n\n## \u57fa\u672c\u7528\u6cd5\n\n\u6700\u7b80\u5355\u7684\u7528\u6cd5\uff0c\u9ed8\u8ba4\u4e0d\u5c55\u5f00\u3002\n\n\x3c!--DemoStart--\x3e \n```js\nclass Demo extends Component {\n  constructor(props) {\n    super(props);\n    this.state = {\n      data: [\n        {\n          label:"\u6e56\u5317\u7701",\n          key:"0-0-0",\n          children:[\n            {\n              label:"\u6b66\u6c49\u5e02",\n              key:"0-1-0",\n              children:[\n                {label:"\u65b0\u6d32\u533a",key:"0-1-1"},\n                {label:"\u6b66\u660c\u533a",key:"0-1-2"},\n                {label:"\u6c49\u5357\u533a",key:"0-1-3"},\n              ]\n            },\n            {label:"\u9ec4\u5188\u5e02",key:"0-2-0"},\n            {\n              label:"\u9ec4\u77f3\u5e02",\n              key:"0-3-0",\n              children:[\n                {label:"\u9752\u5c71\u533a",key:"0-3-1"},\n                {label:"\u9ec4\u9642\u533a",key:"0-3-2"},\n                {label:"\u9752\u5c71\u533a",key:"0-3-3"},\n              ]\n            },\n          ]\n        },{\n          label:"\u4e0a\u6d77\u5e02",\n          key:"1-0-0",\n          children:[\n            {label:"\u9ec4\u6d66\u533a",key:"1-0-1"},\n            {label:"\u5362\u6e7e\u533a",key:"1-0-2"},\n            {\n              label:"\u5f90\u6c47\u533a",\n              key:"1-0-3",\n              children:[\n                {label:"\u534a\u6dde\u56ed\u8def\u8857\u9053",key:"1-1-0"},\n                {label:"\u5357\u4eac\u4e1c\u8def\u8857\u9053",key:"1-2-0"},\n                {label:"\u5916\u6ee9\u8857\u9053",key:"1-3-0"},\n              ]\n            },\n          ]\n        },{\n          label:"\u5317\u4eac\u5e02",\n          key:"2-0-0",\n          children:[\n            {label:"\u4e1c\u57ce\u533a",key:"2-1-0"},\n            {label:"\u897f\u57ce\u533a",key:"2-2-0"},\n            {\n              label:"\u5d07\u6587\u533a",\n              key:"2-3-0",\n              children:[\n                {label:"\u4e1c\u82b1\u5e02\u8857\u9053",key:"2-3-1"},\n                {label:"\u4f53\u80b2\u9986\u8def\u8857\u9053",key:"2-3-2"},\n                {label:"\u524d\u95e8\u8857\u9053",key:"2-3-3"},\n              ]\n            },\n          ]\n        }\n      ]\n    }\n  }\n  render() {\n    return (\n      <Tree \n        data={this.state.data}\n        onExpand={(key,expanded,data,node)=>{\n          console.log("item:",key,expanded,data,node)\n        }}\n      />\n    )\n  }\n}\n```\n\x3c!--End--\x3e\n\n\n## \u6dfb\u52a0\u590d\u9009\u6846\n\n\u8282\u70b9\u524d\u6dfb\u52a0 Checkbox \u590d\u9009\u6846\u3002\n\n\x3c!--DemoStart--\x3e \n```js\nclass Demo extends Component {\n  constructor(props) {\n    super(props);\n    this.state = {\n      data: [\n        {\n          label:"\u6e56\u5317\u7701",\n          key:"0-0-0",\n          children:[\n            {\n              label:"\u6b66\u6c49\u5e02",\n              key:"0-1-0",\n              children:[\n                {label:"\u65b0\u6d32\u533a",key:"0-1-1"},\n                {label:"\u6b66\u660c\u533a",key:"0-1-2"},\n                {label:"\u6c49\u5357\u533a",key:"0-1-3"},\n              ]\n            },\n            {label:"\u9ec4\u5188\u5e02",key:"0-2-0"},\n            {\n              label:"\u9ec4\u77f3\u5e02",\n              key:"0-3-0",\n              children:[\n                {label:"\u9752\u5c71\u533a",key:"0-3-1"},\n                {label:"\u9ec4\u9642\u533a",key:"0-3-2"},\n                {label:"\u9752\u5c71\u533a",key:"0-3-3"},\n              ]\n            },\n          ]\n        },{\n          label:"\u4e0a\u6d77\u5e02",\n          key:"1-0-0",\n          children:[\n            {label:"\u9ec4\u6d66\u533a",key:"1-0-1"},\n            {label:"\u5362\u6e7e\u533a",key:"1-0-2"},\n            {\n              label:"\u5f90\u6c47\u533a",\n              key:"1-0-3",\n              children:[\n                {label:"\u534a\u6dde\u56ed\u8def\u8857\u9053",key:"1-1-0"},\n                {label:"\u5357\u4eac\u4e1c\u8def\u8857\u9053",key:"1-2-0"},\n                {label:"\u5916\u6ee9\u8857\u9053",key:"1-3-0"},\n              ]\n            },\n          ]\n        },{\n          label:"\u5317\u4eac\u5e02",\n          key:"2-0-0",\n          children:[\n            {label:"\u4e1c\u57ce\u533a",key:"2-1-0"},\n            {label:"\u897f\u57ce\u533a",key:"2-2-0"},\n            {\n              label:"\u5d07\u6587\u533a",\n              key:"2-3-0",\n              children:[\n                {label:"\u4e1c\u82b1\u5e02\u8857\u9053",key:"2-3-1"},\n                {label:"\u4f53\u80b2\u9986\u8def\u8857\u9053",key:"2-3-2"},\n                {label:"\u524d\u95e8\u8857\u9053",key:"2-3-3"},\n              ]\n            },\n          ]\n        }\n      ],\n      checkedKeys: [\'2-1-0\'],\n    }\n  }\n  render() {\n    return (\n      <Tree \n        data={this.state.data}\n        checkable={true}\n        checkedKeys={this.state.checkedKeys}\n        onSelect={(key,date,e)=>{\n          console.log(key,date,e)\n        }}\n        onCheck={(keys,date,e)=>{\n          console.log(keys,date,e)\n        }}\n        onExpand={(key,expanded,data,node)=>{\n          console.log("item:",key,expanded,data,node)\n        }}\n      />\n    )\n  }\n}\n```\n\x3c!--End--\x3e\n\n## \u7981\u7528\u8282\u70b9\u548c\u64cd\u63a7\u8282\u70b9\n\n\u901a\u8fc7\u8bbe\u7f6e`disabled={[\'0-3-2\']}`\u6765\u7981\u7528\u5bf9\u5e94\u7684\u8282\u70b9\u3002\n\n\x3c!--DemoStart--\x3e \n```js\nclass Demo extends Component {\n  constructor(props) {\n    super(props);\n    this.state = {\n      data: [\n        {\n          label:"\u6e56\u5317\u7701",\n          key:"0-0-0",\n          children:[\n            {\n              label:"\u6b66\u6c49\u5e02",\n              key:"0-1-0",\n              children:[\n                {label:"\u65b0\u6d32\u533a",key:"0-1-1"},\n                {label:"\u6b66\u660c\u533a",key:"0-1-2"},\n                {label:"\u6c49\u5357\u533a",key:"0-1-3"},\n              ]\n            },\n            {label:"\u9ec4\u5188\u5e02",key:"0-2-0"},\n            {\n              label:"\u9ec4\u77f3\u5e02",\n              key:"0-3-0",\n              children:[\n                {label:"\u9752\u5c71\u533a",key:"0-3-1"},\n                {label:"\u9ec4\u9642\u533a",key:"0-3-2"},\n                {label:"\u9752\u5c71\u533a",key:"0-3-3"},\n              ]\n            },\n          ]\n        },\n      ],\n      checkedKeys: [\'0-3-2\'],\n      disabled: [\'0-3-2\'],\n    }\n  }\n  render() {\n    return (\n      <Tree \n        data={this.state.data}\n        checkable={true}\n        checkedKeys={this.state.checkedKeys}\n        disabled={this.state.disabled}\n        defaultExpandAll={true}\n        onSelect={(key,date,e)=>{\n          console.log(key,date,e)\n        }}\n        onCheck={(keys,date,e)=>{\n          console.log(keys,date,e)\n        }}\n        onExpand={(key,expanded,data,node)=>{\n          console.log("item:",key,expanded,data,node)\n        }}\n      />\n    )\n  }\n}\n```\n\x3c!--End--\x3e\n\n## \u6307\u5b9a\u5b57\u6bb5\u6e32\u67d3\n\n\u9ed8\u8ba4\u6bcf\u4e2a\u8282\u70b9\u901a\u8fc7`label`\u663e\u793a\u6807\u9898\uff0c\u901a\u8fc7`children`\u6765\u8bbe\u7f6e\u5c55\u5f00\u7684\u5b50\u8282\u70b9\u6570\u636e\uff0c\u4e0b\u9762\u8fd9\u4e2a\u5b9e\u4f8b\u662f\u901a\u8fc7\u8bbe\u7f6eoption\uff0c\u5c06\u9ed8\u8ba4\u6e32\u67d3\u6807\u9898\u7684`label`\u6539\u6210`name`\uff0c\u9ed8\u8ba4\u7684`children`\u6539\u6210`info`\u3002\n\n\x3c!--DemoStart--\x3e \n```js\nclass Demo extends Component {\n  constructor(props) {\n    super(props);\n    this.state = {\n      data: [\n        {\n          name:"\u6e56\u5317\u7701",\n          key:"0-0-0",\n          info:[\n            {name:"\u6b66\u6c49\u5e02",key:"0-1-0",},\n            {name:"\u9ec4\u5188\u5e02",key:"0-2-0"},\n            {name:"\u9ec4\u77f3\u5e02",key:"0-3-0",},\n          ]\n        },{\n          name:"\u4e0a\u6d77\u5e02",\n          key:"1-0-0",\n          info:[\n            {name:"\u9ec4\u6d66\u533a",key:"1-0-1"},\n            {name:"\u5362\u6e7e\u533a",key:"1-0-2"},\n            {name:"\u5f90\u6c47\u533a",key:"1-0-3",},\n          ]\n        }\n      ]\n    }\n  }\n  render() {\n    return (\n      <Tree \n        data={this.state.data}\n        option={{\n          children: \'info\',\n          label: \'name\'\n        }}\n        onExpand={(key,expanded,data,node)=>{\n          console.log("item:",key,expanded,data,node)\n        }}\n      />\n    )\n  }\n}\n```\n\x3c!--End--\x3e\n\n## \u8fde\u63a5\u7ebf\n\n\u5e26\u8fde\u63a5\u7ebf\u7684\u6811\uff0c\u901a\u8fc7\u8bbe\u7f6e`showLine`\u3002\n\n\x3c!--DemoStart--\x3e \n```js\nclass Demo extends Component {\n  constructor(props) {\n    super(props);\n    this.state = {\n      data: [\n        {\n          label:"\u6e56\u5317\u7701",\n          label:"\u6e56\u5317\u7701",\n          key:"0-0-0",\n          renderTitle:(title)=>`${title} - \u6807\u9898`,\n          children:[\n            {\n              label:"\u6b66\u6c49\u5e02",\n              key:"0-1-0",\n              children:[\n                {label:"\u65b0\u6d32\u533a",key:"0-1-1"},\n                {label:"\u6b66\u660c\u533a",key:"0-1-2"},\n                {label:"\u6c49\u5357\u533a",key:"0-1-3"},\n              ]\n            },\n            {label:"\u9ec4\u5188\u5e02",key:"0-2-0"},\n            {\n              label:"\u9ec4\u77f3\u5e02",\n              key:"0-3-0",\n              children:[\n                {label:"\u9752\u5c71\u533a",key:"0-3-1"},\n                {label:"\u9ec4\u9642\u533a",key:"0-3-2"},\n                {label:"\u9752\u5c71\u533a",key:"0-3-3"},\n              ]\n            }\n          ]\n        },{\n          label:"\u4e0a\u6d77\u5e02",\n          key:"1-0-0",\n          children:[\n            {label:"\u9ec4\u6d66\u533a",key:"1-0-1"},\n            {label:"\u5362\u6e7e\u533a",key:"1-0-2"},\n            {label:"\u5f90\u6c47\u533a",key:"1-0-3",},\n          ]\n        }\n      ]\n    }\n  }\n  render() {\n    return (\n      <Tree \n        data={this.state.data}\n        showLine\n        onSelect={(key,data,e)=>{\n          console.log("onSelect",key,data,e)\n        }}\n        onExpand={(key,expanded,data,node)=>{\n          console.log("item:",key,expanded,data,node)\n        }}\n      />\n    )\n  }\n}\n```\n\x3c!--End--\x3e\n\n## \u9ed8\u8ba4\u9009\u4e2d\n\n\u6dfb\u52a0\u9ed8\u8ba4\u9009\u4e2d\uff0c\u53ef\u4ee5\u901a\u8fc7\u8bbe\u7f6e `selectedKeys=[\'key\']` \u9ed8\u8ba4\u9009\u4e2d\u83dc\u5355\u3002\n\n\x3c!--DemoStart--\x3e \n```js\nclass Demo extends Component {\n  constructor(props) {\n    super(props);\n    this.state = {\n      data: [\n        {\n          label:"\u6e56\u5317\u7701",\n          key:"0-0-0",\n          children:[\n            {\n              label:"\u6b66\u6c49\u5e02",\n              key:"0-1-0",\n              children:[\n                {label:"\u65b0\u6d32\u533a",key:"0-1-1"},\n                {label:"\u6b66\u660c\u533a",key:"0-1-2"},\n                {label:"\u6c49\u5357\u533a",key:"0-1-3"},\n              ]\n            },\n            {label:"\u9ec4\u5188\u5e02",key:"0-2-0"},\n          ]\n        },{\n          label:"\u4e0a\u6d77\u5e02",\n          key:"1-0-0",\n          children:[\n            {label:"\u9ec4\u6d66\u533a",key:"1-0-1"},\n            {label:"\u5362\u6e7e\u533a",key:"1-0-2"},\n            {\n              label:"\u5f90\u6c47\u533a",\n              key:"1-0-3",\n              children:[\n                {label:"\u534a\u6dde\u56ed\u8def\u8857\u9053",key:"1-1-0"},\n                {label:"\u5357\u4eac\u4e1c\u8def\u8857\u9053",key:"1-2-0"},\n                {label:"\u5916\u6ee9\u8857\u9053",key:"1-3-0"},\n              ]\n            },\n          ]\n        }\n      ],\n      selectedKeys:[\'0-0-0\']\n    }\n  }\n  render() {\n    return (\n      <div>\n        <Button style={{margin:"0 0 10px 0"}} onClick={()=>{\n          this.setState({\n            selectedKeys:this.state.selectedKeys[0]?[]:[\'0-0-0\']\n          })\n        }} size="mini">\u70b9\u51fb\u53d6\u6d88\u9009\u4e2d\u6216\u8005\u9009\u4e2d\u201c\u6e56\u5317\u7701\u201d</Button>\n        <Tree \n          selectedKeys={this.state.selectedKeys}\n          data={this.state.data}\n        />\n      </div>\n    )\n  }\n}\n```\n\x3c!--End--\x3e\n\n## \u9ed8\u8ba4\u5c55\u5f00\u83dc\u5355\n\n\u53ef\u4ee5\u901a\u8fc7\u8bbe\u7f6e `defaultExpandAll={true}` \u9ed8\u8ba4\u5c55\u5f00\u83dc\u5355\n\n\n\x3c!--DemoStart--\x3e \n```js\nclass Demo extends Component {\n  constructor(props) {\n    super(props);\n    this.state = {\n      data: [\n        {\n          label:"\u6e56\u5317\u7701",\n          key:"0-0-0",\n          children:[\n            {\n              label:"\u6b66\u6c49\u5e02",\n              key:"0-1-0",\n              children:[\n                {label:"\u65b0\u6d32\u533a",key:"0-1-1"},\n                {label:"\u6b66\u660c\u533a",key:"0-1-2"},\n                {label:"\u6c49\u5357\u533a",key:"0-1-3"},\n              ]\n            },\n            {label:"\u9ec4\u5188\u5e02",key:"0-2-0"},\n            {\n              label:"\u9ec4\u77f3\u5e02",\n              key:"0-3-0",\n              children:[\n                {label:"\u9752\u5c71\u533a",key:"0-3-1"},\n                {label:"\u9ec4\u9642\u533a",key:"0-3-2"},\n                {label:"\u9752\u5c71\u533a",key:"0-3-3"},\n              ]\n            },\n          ]\n        },{\n          label:"\u4e0a\u6d77\u5e02",\n          key:"1-0-0",\n          children:[\n            {label:"\u9ec4\u6d66\u533a",key:"1-0-1"},\n            {label:"\u5362\u6e7e\u533a",key:"1-0-2"},\n            {\n              label:"\u5f90\u6c47\u533a",\n              key:"1-0-3",\n              children:[\n                {label:"\u534a\u6dde\u56ed\u8def\u8857\u9053",key:"1-1-0"},\n                {label:"\u5357\u4eac\u4e1c\u8def\u8857\u9053",key:"1-2-0"},\n                {label:"\u5916\u6ee9\u8857\u9053",key:"1-3-0"},\n              ]\n            },\n          ]\n        },\n      ]\n    }\n  }\n  render() {\n    return (\n      <Tree \n        defaultExpandAll={true}\n        data={this.state.data}\n        onExpand={(key,expanded,data,node)=>{\n          console.log("item:",key,expanded,data,node)\n        }}\n      />\n    )\n  }\n}\n```\n\x3c!--End--\x3e\n\n## \u8bbe\u7f6e\u7ec4\u4ef6\n\n\x3c!--DemoStart--\x3e \n```js\nclass Demo extends Component {\n  constructor(props) {\n    super(props);\n    this.state = {\n      data: [\n        {\n          label:"\u6e56\u5317\u7701",\n          key:"0-0-0",\n          children:[\n            {\n              label:"\u6b66\u6c49\u5e02",\n              key:"0-1-0",\n              children:[\n                {label:"\u65b0\u6d32\u533a",key:"0-1-1"},\n                {label:"\u6b66\u660c\u533a",key:"0-1-2"},\n                {label:"\u6c49\u5357\u533a",key:"0-1-3"},\n              ]\n            },\n            {label:"\u9ec4\u5188\u5e02",key:"0-2-0"},\n            {\n              label:"\u9ec4\u77f3\u5e02",\n              key:"0-3-0",\n              children:[\n                {label:"\u9752\u5c71\u533a",key:"0-3-1"},\n                {label:"\u9ec4\u9642\u533a",key:"0-3-2"},\n                {label:"\u9752\u5c71\u533a",key:"0-3-3"},\n              ]\n            },\n          ]\n        },\n      ],\n      checkedKeys: [\'0-3-2\'],\n      disabled: [\'0-3-2\'],\n      selectedKeys: [\'0-1-3\'],\n    }\n  }\n  setCheckedKeys(){\n    this.setState({\n      checkedKeys:[\'0-1-1\',\'0-1-3\']\n    })\n  }\n  setSelecteKeys(){\n    this.setState({\n      selectedKeys:[\'0-1-1\']\n    })\n  }\n  resetClean(){\n    \n    this.setState({\n      checkedKeys:[],\n      selectedKeys:[],\n    })\n  }\n  render() {\n    const ButtonGroup = Button.Group;\n    return (\n      <div>\n        <ButtonGroup>\n          <Button size="mini" onClick={()=>this.setCheckedKeys()}>\u6307\u5b9a\u8282\u70b9\u52fe\u9009</Button>\n          <Button size="mini" onClick={()=>this.setSelecteKeys()}>\u6307\u5b9a\u8282\u70b9\u9009\u4e2d</Button>\n          <Button size="mini" onClick={()=>this.resetClean()}>\u6e05\u7a7a</Button>\n        </ButtonGroup>\n        <Tree \n          ref={e=>this.tree = e}\n          data={this.state.data}\n          checkable={true}\n          checkedKeys={this.state.checkedKeys}\n          selectedKeys={this.state.selectedKeys}\n          disabled={this.state.disabled}\n          defaultExpandAll={true}\n          onSelect={(key,date,e)=>{\n            console.log(key,date,e)\n          }}\n          onCheck={(keys,date,e)=>{\n            console.log(keys,date,e)\n          }}\n          onExpand={(key,expanded,data,node)=>{\n            console.log("item:",key,expanded,data,node)\n          }}\n        />\n      </div>\n    )\n  }\n}\n```\n\x3c!--End--\x3e\n\n## Tree\n\n| \u53c2\u6570 | \u8bf4\u660e | \u7c7b\u578b | \u9ed8\u8ba4\u503c |\n| ----- | ----- | ----- | ----- |\n| data | \u5c55\u793a\u6570\u636e | Array | `[]` |\n| selectedKeys | \u8bbe\u7f6e\u9009\u4e2d\u7684\u6811\u8282\u70b9 | String[] | `[]` |\n| checkedKeys | \u590d\u9009\u6846\u9009\u4e2d\u7684`key` | String[] | `[]` |\n| checkStrictly | \u5b50\u8282\u70b9\u4e0d\u53d7\u7236\u8282\u70b9\u63a7\u5236\u8bbe\u7f6e`true` | Boolean | `false` |\n| option | \u914d\u7f6e\u9009\u9879\uff0c\u5177\u4f53\u770b `option` | Object | `-` |\n| defaultExpandAll | \u662f\u5426\u9ed8\u8ba4\u5c55\u5f00\u6240\u6709\u8282\u70b9 | Boolean | `false` |\n| showLine | \u662f\u5426\u5c55\u793a\u8fde\u63a5\u7ebf | Boolean | `false` |\n| checkable | \u8282\u70b9\u524d\u6dfb\u52a0 `Checkbox` \u590d\u9009\u6846 | Boolean | `false` |\n| disabled | \u6570\u7ec4\u5b57\u7b26\u4e32\uff0c\u7981\u7528\u54cd\u5e94\u5bf9\u4e8e key \u7684\u8282\u70b9  | String[] | `false` |\n\n## data\n\n| \u53c2\u6570 | \u8bf4\u660e | \u7c7b\u578b | \u9ed8\u8ba4\u503c |\n| ----- | ----- | ----- | ----- |\n| key | \u6bcf\u4e2a\u6811\u8282\u70b9\u7528\u6765\u4f5c\u4e3a\u552f\u4e00\u6807\u8bc6\u7684\u5c5e\u6027\uff0c\u6574\u9897\u6811\u5e94\u8be5\u662f\u552f\u4e00\u7684\u3002\u6ce8\u610f\uff1a\u6574\u4e2a\u6811\u8303\u56f4\u5185\u7684\u6240\u6709\u8282\u70b9\u7684 key \u503c\u4e0d\u80fd\u91cd\u590d\uff01 | String | `-` |\n| children | \u6307\u5b9a\u5b50\u6811\u7684\u6570\u636e\u5bf9\u8c61\uff0c\u53ef\u4ee5\u6839\u636e`option`\u6765\u6307\u5b9a | Array | - |\n| label | \u6307\u5b9a\u8282\u70b9\u6807\u9898\uff0c\u53ef\u4ee5\u6839\u636e`option`\u6765\u6307\u5b9a | String | `label` |\n\n## option\n\n| \u53c2\u6570 | \u8bf4\u660e | \u7c7b\u578b | \u9ed8\u8ba4\u503c |\n| ----- |----- | ----- |----- |\n| children | \u6307\u5b9a\u5b50\u6811\u7684\u6570\u636e\u5bf9\u8c61 | String | `children` |\n| label | \u6307\u5b9a\u8282\u70b9\u6807\u9898 | String | `label` |\n\n## \u4e8b\u4ef6\n\n| \u53c2\u6570 | \u8bf4\u660e | \u7c7b\u578b | \u9ed8\u8ba4\u503c |\n| ----- |----- | ----- |----- |\n| onSelect | \u70b9\u51fb\u6811\u8282\u70b9\u89e6\u53d1 | Function(keys,data,e) | - |\n| onCheck | \u70b9\u51fb\u590d\u9009\u6846\u89e6\u53d1 | Function(keys,data,e) | - |\n| onExpand | \u5c55\u5f00/\u6536\u8d77\u8282\u70b9\u65f6\u89e6\u53d1 | Function(key,expanded:bool,data,node) | - |\n'}});